<body>
    <h1 align="center">台北捷運人流移動分時呈現</h1>
    <h3>緣起： 此專案為台北捷運分時流量之視覺化呈現，希望透過動畫展演的方式能讓閱聽人清楚了解人流移動情況。</h3>
    <h3>操作： 可以透過下拉選單選取欲觀察之日期。</h3>
    <h3>說明： 在選取日期後，會將捷運各站標上地圖同時從早上6點開始呈現人流移動狀況，直到24時結束。圖中移動之圓圈大小代表人流量之大小，右下角會顯示對應時間。</h3>
    &nbsp;&nbsp;&nbsp;&nbsp;
    <div>

    <script type='text/javascript'>

        var data = ["請選擇","1月2號", "1月3號", "1月4號", "1月5號"];

        var select = d3.select('body')
        .append('select')
        .attr('class','select')
        .on('change',onchange);

        var options = select
        .selectAll('option')
        .data(data).enter()
        .append('option')
        .text(function (d) { return d; });

        function onchange() {

           selectValue = d3.select('select').property('value')
           var start = selectValue + "-1.csv";
           var start_1 = selectValue + "-2.csv"; //沒轉乘站
           var end = selectValue + "-3.csv";

           console.log(selectValue);


           var svg = d3.select('#myid').append('g');


           var div = d3.select("body").append("div").attr("class", "toolTip");


           var station = svg.attr("id", "station");

           var rect_e = 10;



           d3.csv("nodes.csv", function (data) {
                //console.log(data[107]);



                var sta = station.selectAll("g")

                .data(data)

                .enter()

                .append("g");




                sta.append("rect")
                .attr("x", function (d) { return d.Lat - rect_e / 2 })
                .attr("y", function (d) { return d.Lon - rect_e / 2 })
                .attr("width", rect_e)
                .attr("height", rect_e)
                .attr("fill", "#666666")
                .attr("stroke", "#DDDDDD")
                .attr("opacity", 0.8);



                sta

                .on("mousemove", function (d) {

                  div.style("left", d3.event.pageX + 10 + "px");

                  div.style("top", d3.event.pageY - 25 + "px");

                  div.style("display", "inline-block");

                  div.html(d.Name);

                 });
                
                sta

                .on("mouseout", function (d) {

                  div.style("display", "none");

                 });


            });  // 捷運站





            var v = 10 / 30 / 3;  // 假定平均速率

            var scale_max = 900;  // 乘車人數最大值

            var rad = 50;

            //var waiting = 500 / v;

            var waiting = 2000;

            var move = function (x1, y1, x2, y2, Num, c) {      // 從A(x1 ,y1 ) 到  B (x2,y2)

                //var time = Math.sqrt(Math.pow(x1 - x2, 2) + Math.pow(y1 - y2, 2)) / v;
                var time = waiting;

                if (c == 1)
                    time = waiting *2;

                svg.append("circle")
                .attr("cx", x1)
                .attr("cy", y1)

                .attr("r", Num / scale_max * rad)
                .attr("fill", "#666666")
                .attr("stroke", "#DDDDDD")
                .attr("opacity", 0.5)
                .transition()
                .duration(time)
                .attr("cx", x2)
                .attr("cy", y2)
                .remove();

            } // move



            d3.csv(start, function (data_1) {
                d3.csv(end, function (data_2) {
                    d3.csv(start_1, function (data_3) {
                        console.log("data_1");
                        console.log(data_1);
                        console.log("data_2");
                        console.log(data_2);
                        console.log("data_3");
                        console.log(data_3);

                        var size = 6;

                        var i, j;


                        function delay(day_hours, t) {
                            var timetest = new Date().getSeconds();
                            console.log("day_hours" + day_hours);//delay 前段   v是用來判斷小時的   t  是兩段中間 間隔時間   
                            //console.log(selectValue+timetest);
                            document.getElementById("countdown").innerHTML=day_hours + "時";

                            setTimeout(function () {
                                //console.log(day_hours);
                                //move(500, 50, 200, 200);

                                // 每次都重新讀檔




                                for (j = 0; j < data_1.length; j++) {                       // 有轉乘站的data1 
                                      
                                    if (data_1[j].Time == day_hours && data_1[j].Num != 0) {
                                        if (data_1[j].x2 != -1) {                             // 判斷抓資料中的第幾小時   day_hours  測試用所以寫0
                                            move(data_1[j].x1, data_1[j].y1, data_1[j].x2, data_1[j].y2, data_1[j].Num , 0);
                                        }
                                    }

                                }



                                for (j = 0; j < data_3.length; j++) {                      // 沒轉乘站的data3
                                    
                                    if (data_3[j].Time == day_hours && data_3[j].Num != 0) {

                                        move(data_3[j].x1, data_3[j].y1, data_3[j].x2, data_3[j].y2, data_3[j].Num , 1);

                                    }

                                }


                                a(day_hours, t);


                            })

                        }
                        function a(day_hours, t) {                                                    // delay  後段
                            setTimeout(function () {
                                //console.log(day_hours);
                                //move(200, 200, 100, 500);

                                //move(200, 200, 1000, 200);




                                for (j = 0; j < data_2.length; j++) {
                                    
                                    if (data_2[j].Time == day_hours && data_2[j].Num != 0) {
                                        if (data_2[j].x1 != -1)                             // 判斷抓資料中的第幾小時   day_hours  測試用所以寫0
                                            move(data_2[j].x1, data_2[j].y1, data_2[j].x2, data_2[j].y2, data_2[j].Num , 0);
                                    }



                                }


                                if (day_hours != 23) {
                                    day_hours += 1;

                                    setTimeout(function () { delay(day_hours, waiting); }, waiting + 1000);  // 動畫時間


                                }


                            }, t);
                        }


                        // 測試資料中 只有0 1 2 三個時段


                        delay(6, waiting);


                    }) // data_3
                })// data_2 
            })//data_1
        };

    </script>
    </div>
